import React from 'react';
import {Link} from 'react-router-dom';

function Nav() {
    return(
        <nav className="main-nav">
        <ul>
          <li><Nav to='/cats'>Cats</Nav></li>
          <li><Nav to='/dogs'>Dogs</Nav></li>
          <li><Nav to='/computers'>Computers</Nav></li>
        </ul>
      </nav>
    );
}

export default Nav;
